SELECT CalMonth,AddrCatCode1,SUM(ExtCost) AS CostSum,SUM(Quantity) AS QuanSum
FROM Inventory_fact,date_dim,cust_vendor_dim
WHERE Inventory_fact.DateKey = date_dim.DateKey AND Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5 AND date_dim.CalYear = 2011
GROUP BY CUBE(CalMonth,AddrCatCode1)
ORDER BY CalMonth,AddrCatCode1;



SELECT CalQuarter,Zip,Name,SUM(ExtCost) AS CostSum,Count(*) AS INVCOUNT
FROM Inventory_fact,date_dim,cust_vendor_dim
WHERE Inventory_fact.DateKey = date_dim.DateKey AND Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5 
AND (date_dim.CalYear = 2011 OR date_dim.CalYear = 2012)
GROUP BY GROUPING SETS( (CalQuarter,Zip,Name)       ,(CalQuarter,Zip),(CalQuarter,Name) , (Name,Zip) ,CalQuarter,Zip,Name,())
ORDER BY CalQuarter,Zip,Name;



SELECT CompanyName,BPName,SUM(ExtCost) AS COSTSUM,SUM(Quantity) AS QuanSum 
FROM Inventory_fact,branch_plant_dim,company_dim
WHERE Inventory_fact.BRANCHPLANTKEY = branch_plant_dim.BRANCHPLANTKEY AND branch_plant_dim.COMPANYKEY = company_dim.COMPANYKEY AND Inventory_fact.TransTypeKey = 2
GROUP BY ROLLUP(CompanyName,BPName)
ORDER BY CompanyName,BPName; 


SELECT TransDescription,CompanyName,BPName,SUM(ExtCost) AS COSTSUM,Count(*) AS INVCOUNT
FROM Inventory_fact,trans_type_dim,branch_plant_dim,company_dim
WHERE Inventory_fact.BRANCHPLANTKEY = branch_plant_dim.BRANCHPLANTKEY AND branch_plant_dim.COMPANYKEY = company_dim.COMPANYKEY
AND Inventory_fact.TRANSTYPEKEY = trans_type_dim.TRANSTYPEKEY
GROUP BY GROUPING SETS ( (TransDescription,CompanyName,BPName),(TransDescription,CompanyName), TransDescription,())
ORDER BY TransDescription,CompanyName,BPName

SELECT CalYear,CalQuarter,Name,SUM(ExtCost) AS CUSTSUM,Count(*) AS INVCOUNT
FROM Inventory_fact,date_dim,cust_vendor_dim
WHERE Inventory_fact.DateKey = date_dim.DateKey AND Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5 
AND (date_dim.CalYear = 2011 or date_dim.CalYear = 2012)
GROUP BY Name,ROLLUP(CalYear,CalQuarter)
ORDER BY CalYear,CalQuarter,Name; 

SELECT CompanyName,BPName,SUM(ExtCost) AS COSTSUM,SUM(Quantity) AS QuanSum 
FROM Inventory_fact,branch_plant_dim,company_dim
WHERE Inventory_fact.BRANCHPLANTKEY = branch_plant_dim.BRANCHPLANTKEY AND branch_plant_dim.COMPANYKEY = company_dim.COMPANYKEY AND Inventory_fact.TransTypeKey = 2
GROUP BY CompanyName,BPName
UNION
SELECT CompanyName,NULL,SUM(ExtCost) AS COSTSUM,SUM(Quantity) AS QuanSum 
FROM Inventory_fact,branch_plant_dim,company_dim
WHERE Inventory_fact.BRANCHPLANTKEY = branch_plant_dim.BRANCHPLANTKEY AND branch_plant_dim.COMPANYKEY = company_dim.COMPANYKEY AND Inventory_fact.TransTypeKey = 2
GROUP BY CompanyName
UNION
SELECT NULL,NULL,SUM(ExtCost) AS COSTSUM,SUM(Quantity) AS QuanSum 
FROM Inventory_fact,branch_plant_dim,company_dim
WHERE Inventory_fact.BRANCHPLANTKEY = branch_plant_dim.BRANCHPLANTKEY AND branch_plant_dim.COMPANYKEY = company_dim.COMPANYKEY AND Inventory_fact.TransTypeKey = 2
ORDER BY 1,2;


SELECT CalYear,CalQuarter,Name,SUM(ExtCost) AS CUSTSUM,Count(*) AS INVCOUNT
FROM Inventory_fact,date_dim,cust_vendor_dim
WHERE Inventory_fact.DateKey = date_dim.DateKey AND Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5 
AND (date_dim.CalYear = 2011 or date_dim.CalYear = 2012)
GROUP BY CUBE(Name,(CalYear,CalQuarter))
ORDER BY CalYear,CalQuarter,Name; 


SELECT CalMonth,AddrCatCode1,SUM(ExtCost) AS CostSum,SUM(Quantity) AS QuanSum, GROUPING_ID(CalMonth,AddrCatCode1) AS GROUP_NUMBER
FROM Inventory_fact,date_dim,cust_vendor_dim
WHERE Inventory_fact.DateKey = date_dim.DateKey AND Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5 
AND date_dim.CalYear = 2011
GROUP BY CUBE(CalMonth,AddrCatCode1)
ORDER BY CalMonth,AddrCatCode1; 

SELECT CalYear,CalQuarter,Name,SUM(ExtCost) AS CUSTSUM,Count(*) AS INVCOUNT
FROM Inventory_fact,date_dim,cust_vendor_dim
WHERE Inventory_fact.DateKey = date_dim.DateKey AND Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5 
AND (date_dim.CalYear = 2011 or date_dim.CalYear = 2012)
GROUP BY GROUPING SETS(Name,ROLLUP(CalYear,CalQuarter))
ORDER BY CalYear,CalQuarter,Name; 


SELECT Name, SUM(ExtCost) AS CostSum,
  RANK() OVER (ORDER BY SUM(ExtCost) DESC) AS SumCostRank
  FROM Inventory_fact,cust_vendor_dim	
  WHERE Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5
 GROUP BY Name;
 
 SELECT State,Name, SUM(ExtCost) AS CostSum,
  RANK() OVER (PARTITION BY State ORDER BY SUM(ExtCost) DESC) AS SumCostRank
  FROM Inventory_fact,cust_vendor_dim
  WHERE Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5
 GROUP BY State,Name
 ORDER BY State;

SELECT Name, COUNT(*) AS TransCount,
  RANK() OVER (ORDER BY COUNT(*) DESC) AS RankCount,
  DENSE_RANK() OVER (ORDER BY COUNT(*) DESC) AS DenseRankCount
  FROM Inventory_fact,cust_vendor_dim
  WHERE Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.TransTypeKey = 5
 GROUP BY Name;

SELECT Zip,CalYear,CalMonth, SUM(ExtCost) AS SumCost,
  SUM(SUM(ExtCost)) OVER (
    ORDER BY Zip,CalYear,CalMonth
    ROWS UNBOUNDED PRECEDING ) AS CumSumCost
 FROM Inventory_fact,cust_vendor_dim,date_dim
  WHERE Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.DateKey = date_dim.DateKey
  AND Inventory_fact.TransTypeKey = 5
 GROUP BY Zip,CalYear,CalMonth;
 
 SELECT Zip,CalYear,CalMonth, SUM(ExtCost) AS SumCost,
 SUM(SUM(ExtCost)) OVER (PARTITION BY Zip,CalYear
 ORDER BY Zip,CalYear,CalMonth
    ROWS UNBOUNDED PRECEDING ) AS CumSumCost
 FROM Inventory_fact,cust_vendor_dim,date_dim
  WHERE Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND Inventory_fact.DateKey = date_dim.DateKey
  AND Inventory_fact.TransTypeKey = 5
 GROUP BY Zip,CalYear,CalMonth
 ORDER BY Zip,CalYear;

SELECT SecondItemId,SUM(ExtCost) AS CostSum,RATIO_TO_REPORT(SUM(ExtCost)) 
         OVER () AS SumCostRatio
 FROM Inventory_fact,Item_master_dim 
 WHERE Inventory_fact.ItemMasterKey = Item_master_dim.ItemMasterKey AND Inventory_fact.TransTypeKey = 1
 GROUP BY SecondItemId
 ORDER BY SUM(ExtCost) DESC;

SELECT CalYear,SecondItemId,SUM(ExtCost) AS CostSum,RATIO_TO_REPORT(SUM(ExtCost)) 
         OVER (PARTITION BY CalYear) AS SumCostRatio
 FROM Inventory_fact,Item_master_dim,date_dim 
 WHERE Inventory_fact.ItemMasterKey = Item_master_dim.ItemMasterKey AND Inventory_fact.DateKey = date_dim.DateKey AND Inventory_fact.TransTypeKey = 1
 GROUP BY CalYear,SecondItemId
 ORDER BY CalYear,SUM(ExtCost) DESC;

SELECT BPName,CompanyKey,CarryingCost,
  RANK() 
OVER (ORDER BY CarryingCost) As RankCarryingCost,     
  PERCENT_RANK() 
    OVER (ORDER BY CarryingCost) As PercentRankCarryingCost,
  CUME_DIST() 
    OVER (ORDER BY CarryingCost) As CumDistCarryingCost
 FROM branch_plant_dim;

SELECT BPName,CompanyKey,CarryingCost,CumDistCarryingCost
 FROM 
  ( SELECT BPName,branch_plant_dim.CompanyKey,CarryingCost,
  CUME_DIST() 
    OVER (ORDER BY CarryingCost DESC) As CumDistCarryingCost
 FROM branch_plant_dim,company_dim WHERE branch_plant_dim.CompanyKey=company_dim.CompanyKey )
 WHERE CumDistCarryingCost >= 0.85;
 
 SELECT DISTINCT ExtCost,
  CUME_DIST() 
    OVER (ORDER BY ExtCost) As CumDistCarryingCost
FROM Inventory_fact,cust_vendor_dim
WHERE Inventory_fact.CustVendorKey = cust_vendor_dim.CustVendorKey AND State = 'CO'
ORDER BY ExtCost;




CREATE MATERIALIZED VIEW SalesByVendorDateKeyMV2011
BUILD IMMEDIATE
REFRESH COMPLETE ON DEMAND
ENABLE QUERY REWRITE AS
SELECT Inventory_fact.CustVendorKey,date_dim.DateKey, SUM(ExtCost) AS TotalCost, 
       SUM(Quantity) AS TotalQty , Count(*) AS TotalCount
 FROM Inventory_fact,date_dim
 WHERE Inventory_fact.DateKey = date_dim.DateKey
   AND Inventory_fact.TransTypeKey = 5
   AND date_dim.CalYear = 2011
 GROUP BY Inventory_fact.CustVendorKey,date_dim.DateKey;

SELECT * from SalesByVendorDateKeyMV2012

CREATE MATERIALIZED VIEW SalesByVendorDateKeyMV2012
BUILD IMMEDIATE
REFRESH COMPLETE ON DEMAND
ENABLE QUERY REWRITE AS
SELECT Inventory_fact.CustVendorKey,date_dim.DateKey, SUM(ExtCost) AS TotalCost, 
       SUM(Quantity) AS TotalQty , Count(*) AS TotalCount
 FROM Inventory_fact,date_dim
 WHERE Inventory_fact.DateKey = date_dim.DateKey
   AND Inventory_fact.TransTypeKey = 5
   AND date_dim.CalYear = 2012
 GROUP BY Inventory_fact.CustVendorKey,date_dim.DateKey;

SELECT date_dim.CalMonth,cust_vendor_dim.AddrCatCode1,SUM(MV1.TotalCost),SUM(MV1.TotalQty)
 FROM SALESBYVENDORDATEKEYMV2011 MV1,cust_vendor_dim,date_dim
 WHERE MV1.CustVendorKey = cust_vendor_dim.CustVendorKey AND MV1.DateKey = date_dim.DateKey
 GROUP BY CUBE(date_dim.CalMonth,cust_vendor_dim.AddrCatCode1)
 ORDER BY date_dim.CalMonth,cust_vendor_dim.AddrCatCode1;

SELECT  CalQuarter,Zip,Name,SUM(TotalCost) AS NetSum,SUM(TotalCount) AS NetCount
 FROM(
SELECT CalQuarter,Zip,Name,MV1.TotalCost AS TotalCost,MV1.TotalCount AS TotalCount
FROM SALESBYVENDORDATEKEYMV2011 MV1,date_dim,cust_vendor_dim
WHERE MV1.CustVendorKey = cust_vendor_dim.CustVendorKey AND MV1.DateKey = date_dim.DateKey
UNION
SELECT CalQuarter,Zip,Name,MV2.TotalCost AS TotalCost,MV2.TotalCount AS TotalCount
FROM SALESBYVENDORDATEKEYMV2012 MV2,date_dim,cust_vendor_dim
WHERE MV2.CustVendorKey = cust_vendor_dim.CustVendorKey AND MV2.DateKey = date_dim.DateKey )
GROUP BY CUBE(CalQuarter,Zip,Name)
ORDER BY CalQuarter,Zip,Name;    
